import OrcamentoItem from './OrcamentoItem';

function TodosOrcamentos({ orcamentos, clientes, navigate }) {
  return (
    <div>
      {orcamentos.length > 0 ? (
        orcamentos.map((orcamento) => (
          <OrcamentoItem
            key={orcamento.id}
            orcamento={orcamento}
            cliente={clientes[orcamento.clienteId]}
            navigate={navigate}
          />
        ))
      ) : (
        <p>Nenhum or√ßamento encontrado.</p>
      )}
    </div>
  );
}

